import React from 'react'
import './Login.css'

function Login() {
    return (
        <div className='login'>
            <div className='login__container'>
                <img src='https://www.clipartmax.com/png/middle/199-1998476_slack-icon-slack-logo.png' alt='' />
            </div>
            <h1>Login</h1>
        </div>
    )
}

export default Login
